
function biya (){
    let h_item = document.getElementsByClassName('navbar-header')[0];
    let g = h_item.getElementsByTagName('span');
    h_item.style.justifyContent = 'right';
    h_item.style.transform = 'rotate(180deg)';
    hide(h_item.getElementsByTagName('span'))
    h_item.style.filter = 'grayscale(1)';
}
function biai(){
    try{
        let y = document.getElementsByClassName('navpage-main')[0].getElementsByTagName('iframe')[0].contentWindow.document.querySelectorAll('[id^=gen-ai]');    
        let u = Array.from(y[0].parentElement.getElementsByClassName('noAI'));
        if(y){ hide(y) }
        console.log(u)
        if (u.length == 0 ){
            let div = document.createElement('div');
            div.innerHTML = `
                <div class='noAI' style="width: 100%; display: flex; align-items: center; justify-content: center;">
                    <style>
                        .sub_div_one{
                            width:25%;
                            display: flex;
                            align-items: center;
                            justify-content: center;
                            flex-direction: row;
                            margin-bottom: 2vh;
                        }   
                        .sub_div_one img{
                            height: 10vh;
                        }
                        .sub_div_one h2{
                            margin-left: 2vw;
                        }
                    </style>
                    <div class="sub_div_one">
                        <img title='Shiny Metal AI' src="data:image/png;base64,"/>
                        <!-- <h2>Take a break AI..</h2> -->
                    </div>
                </div>
            `
            y[0].parentElement.appendChild(div)
        }
    }
    catch(er){
        console.log(er)
    }

}
function hide(htmlcollection){
    Array.from(htmlcollection).forEach(i=>{
        i.style.setProperty("display", "none", "important");
    });
}
try{
    biya();
    setInterval(biai,500)
    
}
catch(er){
    console.log(er)
}